import React from "react";

export default function currtime() {
  let date = new Date();

  return (
    <div>
      {date.toLocaleString("en-US", {
        hour: "numeric", // numeric, 2-digit
        minute: "numeric", // numeric, 2-digit
        second: "numeric", // numeric, 2-digit
      })}
    </div>
  );
}
